import React, { useState, useRef, useEffect } from "react";
import { useTheme } from "../contexts/ThemeContext";
import { useLanguage } from "../contexts/LanguageContext";
import { motion, AnimatePresence } from "framer-motion";

const LanguageSwitcher = () => {
  const { theme } = useTheme();
  const { language, setLanguage, text, availableLanguages } = useLanguage();
  const [isOpen, setIsOpen] = useState(false);
  const dropdownRef = useRef(null);

  // Handle click outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setIsOpen(false);
      }
    };

    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, []);

  // Get current language data for display
  const currentLang = availableLanguages.find(lang => lang.code === language) || availableLanguages[0];

  // Handle language change
  const handleLanguageChange = (langCode) => {
    setLanguage(langCode);
    setIsOpen(false);
  };

  return (
    <div className="relative" ref={dropdownRef}>
      <motion.button
        onClick={() => setIsOpen(!isOpen)}
        className={`flex items-center space-x-1.5 px-3 py-1.5 rounded-lg text-sm font-medium transition-all duration-200 ${
          theme === "light"
            ? "bg-slate-100 hover:bg-slate-200 text-slate-700"
            : "bg-slate-800 hover:bg-slate-700 text-slate-200"
        }`}
        whileHover={{ scale: 1.05 }}
        whileTap={{ scale: 0.95 }}
      >
        <span className="text-base">{currentLang?.flag}</span>
        <span className="hidden sm:inline">{currentLang?.code.toUpperCase()}</span>
        <motion.svg
          className="w-4 h-4"
          initial={{ rotate: 0 }}
          animate={{ rotate: isOpen ? 180 : 0 }}
          transition={{ duration: 0.2 }}
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
        </motion.svg>
      </motion.button>

      {/* Dropdown */}
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -10 }}
            transition={{ duration: 0.2 }}
            className={`absolute right-0 mt-2 w-40 rounded-lg shadow-lg z-50 overflow-hidden ${
              theme === "light" 
                ? "bg-white border border-slate-100" 
                : "bg-slate-800 border border-slate-700"
            }`}
          >
            <motion.div 
              className="p-1"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 0.2, delay: 0.1 }}
            >
              {availableLanguages.map((lang) => (
                <motion.button
                  key={lang.code}
                  onClick={() => handleLanguageChange(lang.code)}
                  className={`flex items-center w-full px-3 py-2 text-left rounded-md transition-colors ${
                    language === lang.code
                      ? theme === "light"
                        ? "bg-indigo-100 text-indigo-600"
                        : "bg-indigo-900/30 text-indigo-400"
                      : theme === "light"
                        ? "text-slate-700 hover:bg-slate-100"
                        : "text-slate-200 hover:bg-slate-700"
                  }`}
                  whileHover={{ x: 4 }}
                >
                  <span className="text-base mr-3">{lang.flag}</span>
                  <span className="flex-1">{lang.name}</span>
                  {language === lang.code && (
                    <motion.svg 
                      initial={{ scale: 0 }}
                      animate={{ scale: 1 }}
                      className={`w-4 h-4 ${
                        theme === "light" ? "text-indigo-600" : "text-indigo-400"
                      }`} 
                      fill="none" 
                      stroke="currentColor" 
                      viewBox="0 0 24 24" 
                    >
                      <path 
                        strokeLinecap="round" 
                        strokeLinejoin="round" 
                        strokeWidth={2} 
                        d="M5 13l4 4L19 7" 
                      />
                    </motion.svg>
                  )}
                </motion.button>
              ))}
            </motion.div>

            {/* Gradient decoration at bottom */}
            <div className={`h-1 w-full ${
              theme === "light" 
              ? "bg-gradient-to-r from-indigo-500 to-violet-500" 
              : "bg-gradient-to-r from-indigo-600 to-violet-600"
            }`} />
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default LanguageSwitcher;
